    <Link href="/p/[id]" as={`/p/${props.id}`}>
      <a>{props.id}</a>
    </Link>
  </li>
  );
const Index = props =>( 
    <div>
        <h1>My Blog</h1>
        <ul>
            <PostLink id="hello next.js"/>
            <PostLink id="Learn Next.js is awesome"/>
            <PostLink id="Deploy apps with Zeit"/>
        </ul>
    </div>
);

Index.getInitialProps = async () => {
  console.log('hola')
}

export default Layout(Index);
